import { Table } from 'antd';


function TableCom({feilds}) {
 
    const columns = [
        {
            title: 'Id',
            dataIndex: 'id',
            key: 'id',
            width: 30,
            sorter: (a, b) => a.id - b.id,
          },
      {
        title: 'Name',
        dataIndex: 'name',
        key: 'name',
        width: 50,
        
