          {
            text: 'Joe',
            value: 'Joe',
          }
        ],
        onFilter: (value, record) => record.name.indexOf(value) === 0,
      },
      {
        title: 'Feilds',
        children: [
          {
            title: 'Id',
            dataIndex: 'id',
            key: 'id',
            width: 30,
            sorter: (a, b) => a.id - b.id,
          },
          {
            title: 'Name',
            dataIndex: 'name',
            key: 'name',
            width: 50,
            
            filters: [
              {
                text: 'Joe',
                value: 'Joe',
              },
            ],
            onFilter: (value, record) => record.name.indexOf(value) === 0,
          },
          {
            title: 'Type',
            dataIndex: 'type',
            key: 'type',
            width: 30,
          },
          {
            title: 'Is Mandatory',
            dataIndex: 'is mandatory',
            key: 'is mandatory',
            width: 30,
          },
          {
            title: 'Options',
            children: [
             
                {
                    title: 'Id',
                    dataIndex: 'id',
                    key: 'id',
                    width: 30,
                    sorter: (a, b) => a.id - b.id,
                  },
                  {
                    title: 'Name',
                    dataIndex: 'name',
                    key: 'name',
                    width: 50,
                   
                    filters: [
                      {
                        text: 'Joe',
                        value: 'Joe',
                      },
                      
                    ],
                    onFilter: (value, record) => record.name.indexOf(value) === 0,
                  },
                  {
                    title: 'Has Comment',
                    dataIndex: 'has comment',
                    key: 'has comment',
                    width: 50,
                    
                  },
            ],
          },
        ],
      },
     
    ];
    
    const data = [];
    for (let i = 0; i < 5; i++) {
      data.push({
        key: i,
        name: feilds?.name,
        id: i + 1,
       
      });
    }
