  return (
    <div>
       <Table
    columns={columns}
    dataSource={data}
    bordered
    size="middle"
    scroll={{ x: 'calc(700px + 50%)', y: 240 }}
    // style={{width:"70%"}}
  />
    </div>
  );
  }
export default TableCom;
